import React from 'react';

class Login extends React.Component {
  render() {
    return(
      <div className="container">
        <div className="row">
          <div className="col-md-6" style= { { position : 'relative', left: '300px'}}>
              Email and Password
          </div>
        </div>    
      </div>
    )
  }
}

export default Login;
